import React from 'react';
import logo from './logo.svg';
import './App.css';


// Example

interface DisplayNameProps {
  name: string
}

const DisplayName = ({ name }: DisplayNameProps) => {
  return <h1>{ name }</h1>
}

function App() {
  return (
    <div className="App">
      <DisplayName name={[1, 2, 3, 4]} />
    </div>
  );
}

export default App;
